import React from 'react'
import {useState} from 'react'
import List from './List';
import Form from './Form';
import './styles.css'


function Contacts() {
    const [contacts,setContacts] = useState([
        {fullName:"ayse",phoneNumber:"232323"},
        {fullName:"veli",phoneNumber:"444"},
        {fullName:"ali",phoneNumber:"11"},
        {fullName:"ahmet",phoneNumber:"555"},
        {fullName:"denz",phoneNumber:"998"},
        {fullName:"busra",phoneNumber:"7868"},
    ]);
  return (
    <div id="container">  <h1>Contacts</h1>
    <List contacts={contacts}/>
    <Form addContact={setContacts} contacts={contacts} />
    </div>
  )
}

export default Contacts;
